selector_to_html = {"a[href=\"#problems\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Problems<a class=\"headerlink\" href=\"#problems\" title=\"Permalink to this heading\">#</a></h2><p>Reports grouped as collections</p><p>Duplicates</p>", "a[href=\"#parliamentary-papers\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Parliamentary Papers<a class=\"headerlink\" href=\"#parliamentary-papers\" title=\"Permalink to this heading\">#</a></h1><p>The NLA has digitised a large collection of reports and papers presented to the Commonwealth Parliament.</p>", "a[href=\"../../understanding-search/finding-digitised-content.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13. </span>Finding NLA digitised content you can download<a class=\"headerlink\" href=\"#finding-nla-digitised-content-you-can-download\" title=\"Permalink to this heading\">#</a></h1><p>Trove provides a platform for the delivery of digitised content from the National Library of Australia and its partners. This digitised content is easy to find in the <em>Newspapers &amp; gazettes</em> and <em>Magazines &amp; newsletters</em> categories \u2013 they\u2019re full of it! But it\u2019s not so easy to find digitised content in other categories where it\u2019s mixed with works aggregated from a range of different sources.</p><p>There are a few different approaches to finding digitised content, but they all have potential problems. While I highlight what I think is the most reliable option, it\u2019s really a matter of working out what will best meet your research needs.</p>", "a[href=\"#finding-parliamentary-papers\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Finding Parliamentary Papers<a class=\"headerlink\" href=\"#finding-parliamentary-papers\" title=\"Permalink to this heading\">#</a></h2><p>As documented in <a class=\"reference internal\" href=\"../../understanding-search/finding-digitised-content.html\"><span class=\"doc std std-doc\">Finding NLA digitised content you can download</span></a>, you can find NLA digitised resources by searching for <code class=\"docutils literal notranslate\"><span class=\"pre\">\"nla.obj\"</span></code> and selecting the \u2018Online\u2019 facet (if you\u2019re using the API set <code class=\"docutils literal notranslate\"><span class=\"pre\">l-availability</span></code> to <code class=\"docutils literal notranslate\"><span class=\"pre\">y</span></code>). To further limit the results to Parliamentary Papers there are a couple of possibilities:</p>", "a[href=\"#grouping-and-describing-parliamentary-papers\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Grouping and describing Parliamentary Papers<a class=\"headerlink\" href=\"#grouping-and-describing-parliamentary-papers\" title=\"Permalink to this heading\">#</a></h2><p>The way digitised Parliamentary Papers are grouped and described in Trove is inconsistent and sometimes confusing.</p><p>As noted above, individual Parliamentary Papers are often treated as issues of a periodical. But not always. Sometimes they are described as standalone works. This <a class=\"reference external\" href=\"https://trove.nla.gov.au/work/9710970?\">report by the Australian Science and Technology Council on \u2018Marine sciences and technologies in Australia\u2019</a> is treated like a book, and is linked to a single digitised resource. It might have been grouped with a <a class=\"reference external\" href=\"https://trove.nla.gov.au/work/9988298\">follow-up report from the next year</a>, but it doesn\u2019t really matter as they\u2019re both easily discoverable.</p>", "a[href=\"#research-implications\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Research implications<a class=\"headerlink\" href=\"#research-implications\" title=\"Permalink to this heading\">#</a></h2><p>Search - can\u2019t assume everything will be in results, drill down through collections</p><p>API</p>", "a[href=\"#overview-of-parliamentary-papers\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Overview of Parliamentary Papers<a class=\"headerlink\" href=\"#overview-of-parliamentary-papers\" title=\"Permalink to this heading\">#</a></h2><p>Using harvested dataset \u2013 visualise by year etc.</p>", "a[href=\"../../what-is-trove/collections.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Collections within collections<a class=\"headerlink\" href=\"#collections-within-collections\" title=\"Permalink to this heading\">#</a></h1><h2>isPartOf<a class=\"headerlink\" href=\"#ispartof\" title=\"Permalink to this heading\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
